class Solution:
    def checkEqualTree(self, root: TreeNode) -> bool:
        def _sum(node, seen):
            if not node:
                return 0
            s = node.val + _sum(node.left, seen) + _sum(node.right, seen)
            seen.add(s)
            return s

        seen = set()
        total = _sum(root, seen)
        return total % 2 == 0 and (total // 2) in seen
