def min_steps(s: str, t: str) -> int:
    char_count = {}
    for c in s:
        char_count[c] = char_count.get(c, 0) + 1
    for c in t:
        char_count[c] = char_count.get(c, 0) - 1

    steps = sum(abs(count) for count in char_count.values())

    return steps // 2
