def max_covered_rows(matrix, num_select):
    m, n = len(matrix), len(matrix[0])
    max_covered = 0
    for i in range(1 << n):
        if bin(i).count('1') == num_select:
            covered = 0
            for row in range(m):
                for col in range(n):
