def flip_trees(n, queries):
    flipped_nodes = {}
    for query in queries:
        flipped_nodes[query] = not flipped_nodes.get(query, False)
        while query > 1:
            query //= 2
            flipped_nodes[query] = not flipped_nodes.get(query, False)

    count = 0
    for value in flipped_nodes.values():
        if value:
            count += 1

    return count
